dvml=function(){"use strict";function n(n,t){var i=$("#"+n);if(t.startsWith("POST")){var r=t.split("|"),u=r[1],f=r[2];$.ajax({url:u,data:f,contentType:"application/json; charset=utf-8",dataType:"json",type:"POST",cache:!1,success:function(n){n.success&&i.append(n.html)}})}else $.ajax({url:t,type:"GET",cache:!1,success:function(n){i.append(n)}})}function t(n){$("#"+n).remove()}return{add:n,remove:t}}();